discs, wafers or similar forms, they fall in heading 38.18.
Subheading Note.
1.- For the purposes of subheading 2852.10, the expression “chemically defined” means all organic or inorganic compounds of mercury meeting the requirements of paragraphs
(a) to (e) of Note 1 to Chapter 28 or paragraphs (a) to (h) of Note 1 to Chapter 29.

